import styled from 'styled-components'

const Language = styled.div`
  flex: 1 1 auto;
  height: 60px;
  display: flex;
  flex-direction: column;
  width: 40px;
  max-width: 40px;
  min-width: 40px;
  justify-content: flex-start;
  align-items: flex-start;
  padding-top: 12px;
  box-sizing: border-box;

  img {
    width: 16px;
    object-fit: contain;
  }
`

export default Language
